import React from 'react';
import './header.css'

function Header() {
  return (
    <>
       <header>
        <h1>Кристина</h1>
        <p>Ваше краткое описание или девиз</p>


    </header>

  
    <nav>
        <a href="/">Главная</a>
        <a href="/projects">Проекты</a>
        <a href="/gallery">Галерея</a>
        <a href="/contact">Контакты</a>
        <a href="/politics">Политика-Х</a>
    </nav>
</>
  );
}

export default Header;
